import {Service} from './Service'
export function login(data) {
  return Service({
    url: '/login',
    method: 'post',
    data
  })
}
export function register(data) {
  return Service({
    url: '/register',
    method: 'post',
    data: data
  })
}
// 用户获取
export function getStudent(data) {
  return Service({
    url: '/student',
    method: 'post',
    data: data
  })
}
